import React from 'react';
import CartItem from '../CartItem/CartItem';

const CartList = (props) => {

    const { setModalProps, setIsModalActive, removeFromCart, increment, cart, dicrement } = props

    return (
        <saction>
            <ul className='cart-list'>
                {cart.map((el) => <CartItem key={el.article} card={el} setModalProps={setModalProps} setIsModalActive={setIsModalActive} removeFromCart={removeFromCart} increment={increment} article={el.article} dicrement={dicrement} src={el.src} header={el.header} count={el.count} />)}
            </ul>
        </saction>
    );
}

export default CartList;
